import "./display.css";

const Display = ({ input, result, firstNum, lastNum, isResult }) => {
  return (
    <div className="display">
      <div>{isResult}</div>
      <div>{isResult || (!firstNum && !lastNum) ? result : input}</div>
    </div>
  );
};

export default Display;
